import React from 'react';
import {Link} from 'react-router-dom';
const PuppiesSold = () =>{
   const puppies = [
        {_id: 1, name: "Emma", gender: "Female", rank: "Adopted", icon: 'https://github.com/KrotzerSoftwareDevelopment/homeraised/blob/main/src/assets/Puppies/Origin%20Litter/Emma/emma.png?raw=true', dob: "05/10/20" },
        {_id: 2, name: "Leo", gender: "Male", rank: "Adopted", icon: " ", dob: "05/10/20", },
        {_id: 3, name: "Milo", gender: "Male", rank: "Adopted", dob: "05/10/20", },
]
return (
<div >
        <h1> Puppies </h1>
    {puppies.map(puppy =>
//  <Link to={'/puppy/' + puppy._id}>
    <div id="PuppyHomeCard">
        {puppy.id}

        {puppy.name}
        <div id="puppyIcon">
        <img
         id=""
          src={puppy.icon}
          alt="Third slide"
          className="icon"
        />
        </div>


        </div>
        // </Link>
        )}

</div>

)
}
export default PuppiesSold;
